import React from "react";
import {
  FaDribbbleSquare,
  FaFacebookSquare,
  FaGithubSquare,
  FaInstagram,
  FaTwitterSquare,
} from "react-icons/fa";

const Footer = () => {
  return (
    <div className="py-16 px-4 text-gray-300 lg:grid-cols-3 grid mx-auto">
      <div>
        <h1 className="text-3xl text-[#00df91] font-bold w-full text-left">
          REACT.
        </h1>
        <p className="py-3 text-start">
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Sunt
          expedita possimus quaerat molestiae, ex accusamus eligendi dolorum,
        </p>
      </div>
      <div className="flex justify-between md:first-letter:w-[75%] my-6">
        <FaFacebookSquare size={30} />
        <FaInstagram size={30} />
        <FaTwitterSquare size={30} />
        <FaGithubSquare size={30} />
        <FaDribbbleSquare size={30} />
      </div>
    </div>
  );
};

export default Footer;
